import React, { useEffect } from "react";
import OOTDForm from "./components/OOTDForm";
import ResultPage from "./components/ResultPage";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";


const loadKakaoSDK = () => {
  return new Promise((resolve) => {
    if (window.kakao && window.kakao.maps) {
      resolve(window.kakao);
    } else {
      const script = document.createElement("script");
      script.src =
        "https://dapi.kakao.com/v2/maps/sdk.js?appkey=2380b0c6e08137415b69715b13439001&autoload=false&libraries=services";
      script.async = true;
      document.head.appendChild(script);
      script.onload = () => {
        resolve(window.kakao);
      };
    }
  });
};

function App() {
  useEffect(() => {
    loadKakaoSDK().then((kakao) => {
      console.log("? Kakao SDK Loaded:", kakao);
    });
  }, []);

  return <OOTDForm />;
}

export default App;
